export default function Home() {
  return (
    <>
      
      <Heading>Log In / Sign Up</Heading>
      <Flex m={{base: '10px', md: '150px'}} mt={{}} direction="row" wrap='wrap' justifyContent="space-between" minWidth={'max-content'} p="10px">
        <SignIn />
        <SignUp />
      </Flex>
    </>
    
  );
}
